import React from 'react';
import Header from './navBar';
import Footer from './footer';
import './contactUs.css';



function Contact() {
  return (
    <div>
      <Header />
      <div className="content">
        <div className="call">
          <h2>Talk to Us</h2>
        </div>
        <div className="custom"></div>
      </div>
      <Footer />
    </div>
  )
}

export default Contact;
